  "operations": [
   {
    "data_source": "Site DB",
    "raw_sql": "SELECT\n    customer,\n    SUM(outstanding_amount) AS total_outstanding\nFROM\n    `tabSales Invoice`\nWHERE\n    status IN ('Unpaid', 'Overdue', 'Partly Paid')\n    AND outstanding_amount > 0\nGROUP BY\n    customer\n",
    "type": "sql"
   }
  ],
  "title": "Customer from SI",
  "use_live_connection": true
 },
 {
  "is_builder_query": false,
  "is_native_query": true,
  "is_script_query": false,
  "name": "e5pzzlfm",
  "operations": [
   {
    "data_source": "Site DB",
    "raw_sql": "SELECT\n    sii.item_code,\n    sii.item_name,\n    SUM(sii.qty) AS total_quantity,\n    SUM(sii.amount) AS total_amount,\n    DATE_FORMAT(si.posting_date, '%Y-%m') AS sales_month\nFROM\n    `tabSales Invoice Item` AS sii\nJOIN\n    `tabSales Invoice` AS si ON sii.parent = si.name\nWHERE\n    si.docstatus = 1\nGROUP BY\n    sii.item_code, sales_month\nORDER BY\n    sales_month ASC, total_quantity DESC;\n",
    "type": "sql"
   }
  ],
  "title": "Item from SI",
  "use_live_connection": true
 },
 {
  "is_builder_query": false,
  "is_native_query": true,
  "is_script_query": false,
  "name": "7qnwphoe",
  "operations": [
   {
    "data_source": "Site DB",
    "raw_sql": "SELECT\n    sii.item_code,\n    sii.item_name,\n    SUM(sii.qty) AS total_quantity,\n    SUM(sii.amount) AS total_amount,\n    YEAR(si.posting_date) AS sales_year\nFROM\n    `tabSales Invoice Item` AS sii\nJOIN\n    `tabSales Invoice` AS si ON sii.parent = si.name\nWHERE\n    si.docstatus = 1\nGROUP BY\n    sii.item_code, sales_year\nORDER BY\n    sales_year ASC, total_quantity DESC;\n",
    "type": "sql"
   }
  ],
  "title": "Yearly Sales",
  "use_live_connection": true
 }
